import React, {Component} from 'react';
import {useParams} from "react-router-dom";

function Details()  {
    let { id } = useParams();
        return (
            <div className="data-in-page">
                <p>Hello {this.props.typ} with {id} </p>
            </div>
        );

}

export default Details;
